import React from 'react';
import { View, StyleSheet } from 'react-native';
import { LocationHeader } from './';
const LocationPage = () => {
    return (
        <View style={styles.loc_page}>
            <LocationHeader />
        </View>
    );
}

const styles = StyleSheet.create({})

export default LocationPage;
